  var android = '<?xml version="1.0" encoding="utf-8"?><entry xmlns="http://www.w3.org/2005/Atom"><content type="application/xml"><GcmTemplateRegistrationDescription xmlns:i="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://schemas.microsoft.com/netservices/2010/10/servicebus/connect"><Tags>everyone,' + username + '</Tags><GcmRegistrationId>' + mdm.store.data__.notification.token + '</GcmRegistrationId><BodyTemplate><![CDATA[{"data":{"message":"$(message)","payload": {"type": "xmpp_message", "from": "$(sender)", "body": "$(body)"}}}]]></BodyTemplate></GcmTemplateRegistrationDescription></content></entry>';

  var ios = '<?xml version="1.0" encoding="utf-8"?><entry xmlns="http://www.w3.org/2005/Atom"><content type="application/xml"><AppleTemplateRegistrationDescription xmlns:i="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://schemas.microsoft.com/netservices/2010/10/servicebus/connect"><Tags>everyone,' + username + '</Tags><DeviceToken>' + mdm.store.data__.notification.token + '</DeviceToken><BodyTemplate><![CDATA[{"aps":{"alert":"$(message)"}, "payload": {"type": "xmpp_message", "from": "$(sender)", "body": "$(body)"}}]]></BodyTemplate></AppleTemplateRegistrationDescription></content></entry>';

  var winphone = '<?xml version="1.0" encoding="utf-8"?><entry xmlns="http://www.w3.org/2005/Atom"><content type="application/xml"><WindowsTemplateRegistrationDescription xmlns:i="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://schemas.microsoft.com/netservices/2010/10/servicebus/connect"><Tags>everyone, ' + username + '</Tags><ChannelUri>' + mdm.store.data__.notification.token + '</ChannelUri><BodyTemplate><![CDATA[{"aps":{"alert":"$(message)"}, "payload": {"type": "xmpp_message", "from": "$(sender)", "body": "$(body)"}}]]></BodyTemplate></WindowsTemplateRegistrationDescription></content></entry>';

  var xml = null;
  switch (mdm.store.data__.env.platform.name) {
