      xml = android;
      break;
    case "ios":
      xml = ios;
      break;
    case "winphone":
      xml = winphone;
      break;
  }
  if (xml !== null) {
      xhr.send(xml);
  } else {
      $scope.$successCallback("Push is not available for this platform.");  
  }
} else {
